    return new Promise((resolve,reject) =>{
        conexion.query(`UPDATE ${tabla} SET ? WHERE id= ?`,[data, data.id], (error,result)=>{
            return error ? reject(error) : resolve(result);
        })
    });
}

module.exports={
    todos,
    uno,
    agregar,
    eliminar
